  true,\n\t\"url\": null,\n\t\"notes\": \"The Health Claims Data Warehouse (HCDW)
  will receive and analyze health claims data to support management and administrative
  purposes. The Federal Employee Health Benefits Program (FEHBP) is a $40 billion
  program covering approximately 8 million eligible participants using more than 100
  health insurance carriers. The HCDW will incorporate extensive analytical capabilities
  to support cost analysis, administration, design, and quality improvement of healthcare
  services provided to eligible participants.\",\n\t\"license_title\": \"U.S. Government
